import React from 'react'
import Nav from './Nav'
import {Taka} from './Components'
const Liked = () => {
    let list = [0,1,2]
	return (
		<>
		<Nav colour={"ash"} visible={true} stick={false} ></Nav>

		<div className="items">
					{list.map((list)=>{
						return(
                              <div className="item">
                              	<div className="image">
                              	 <img src="images/aot.jpg" alt=""/>
                              	</div>
                              	<div className="title">
                              		<h1>Attack on titan Vol. 1</h1>
                              	</div>

                              	<Taka num={"mini"} taka={"220"} ></Taka>
                              	<div className="like">
                              		<img src="images/favourite.png" alt=""/>
                              	</div>


                              </div>
						)
					})}
				</div>
		</>
	)
}

export default Liked
